      return Customer.findOne({ _id: value }).then(item => {
        if (!item) {
          return Promise.reject(value + ' not found')
        }
      })
    })
  ],
  validateDelete: [
    param('id').exists().withMessage('id not found').custom(value => {
      return Order.findOne({ _id: value }).then(item => {
        if (!item) {
          return Promise.reject(value + ' not found')
        }
      })
